  \"2015-09-01T18:25:36.222726\",\n\t\"name\": \"the-extent-of-trafficking-in-the-supplemental-nutrition-assistance-program-2009-2011\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Trafficking of Supplemental Nutrition Assistance
  Program (SNAP) benefits occurs when SNAP recipients sell their benefits for cash
  to food retailers, often at a discount. Although trafficking does not increase costs
  to the Federal Government, it is a diversion of program benefits from their intended
  purpose of helping low-income families access a nutritious diet. This report, the
  latest in a series of periodic analyses, provides estimates of the extent of trafficking
  during the period 2009 through 2011.\",\n\t\"license_title\": \"Creative Commons
